// In src/App.js

import React from 'react';
import LandingPage from './components/Landing'; // Import the component
import Home from './components/Home'; // Import the component

import {
  BrowserRouter as Router,
  Route,
  Routes,
  Redirect
} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/home" element={<Home />} />
          // Add more routes as needed
        </Routes>
      </Router>
    </div>
  );
}

export default App;
